# 
change_cpu_gpu_renderer() {
    clear
    echo "Changing CPU-GPU renderer..."
    show_message_with_pause "Select an option:" 1
    while true; do
        echo "___________________"
        echo "RENDERER"
        echo "____________"
        echo "SELECT:"
        echo "●[1]: GPU"
        echo "●[2]: CPU"
        echo "●[3]: Back"
        read -p "Option: " option
        case "$option" in
            1)
                # 
                echo "Configuring renderer to GPU..."
                adb shell setprop debug.hwui.renderer gpu
                show_success_message
                clean_screen_and_return
                ;;
            2)
                # 
                echo "Configuring renderer to CPU..."
                adb shell setprop debug.hwui.renderer skiagl
                show_success_message
                clean_screen_and_return
                ;;
            3)
                # 
                clean_screen_and_return
                ;;
            *)
                echo "Invalid option, please select again."
                ;;
        esac
    done
}

# 
change_opengl_to_vulkan() {
    clear
    echo "Changing from OpenGL to Vulkan..."
    show_message_with_pause "Select an option:" 1
    while true; do
        echo "___________________"
        echo "OpenGL 》Vulkan!"
        echo "___________________"
        echo "Select:"
        echo "●[d]: Default"
        echo "●[v]: Vulkan"
        echo "●[o]: OpenGL"
        echo "●[s]: SkiaGL"
        echo "•[x]: Return to Menu"
        read -p "Option: " option
        case "$option" in
            d)
                # 
                echo "Configuring to default value (OpenGL)..."
                adb shell setprop debug.hwui.renderer opengl
                show_success_message
                clean_screen_and_return
                ;;
            v)
                # 
                echo "Configuring to Vulkan..."
                adb shell setprop debug.hwui.renderer vulkan
                show_success_message
                clean_screen_and_return
                ;;
            o)
                # 
                echo "Configuring to OpenGL..."
                adb shell setprop debug.hwui.renderer opengl
                show_success_message
                clean_screen_and_return
                ;;
            s)
                # 
                echo "Configuring to SkiaGL..."
                adb shell setprop debug.hwui.renderer skiagl
                show_success_message
                clean_screen_and_return
                ;;
            x)
                # 
                clean_screen_and_return
                ;;
            *)
                echo "Invalid option, please select again."
                ;;
        esac
    done
}

