                # 
                echo "Configuring 256mb..."
                adb shell settings put global ram_expand_size 256
                show_success_message
                clean_screen_and_return
                ;;
            3)
                # 
                echo "Configuring 512mb..."
                adb shell settings put global ram_expand_size 512
                show_success_message
                clean_screen_and_return
                ;;
            4)
                # 
                echo "Configuring 1GB..."
                adb shell settings put global ram_expand_size 1024
                show_success_message
                clean_screen_and_return
                ;;
            5)
                # 
                echo "Configuring 2GB..."
                adb shell settings put global ram_expand_size 2096
                show_success_message
                clean_screen_and_return
                ;;
            6)
                # 
                clean_screen_and_return
                ;;
            *)
                echo "Invalid option, please select again."
                ;;
        esac
    done
}


