main() {
    while true; do
        show_main_menu_title
        echo "1) High Performance Tweaks    5) RAM PLUS TOOLS"
        echo "2) Accelerate Hardware        6) Boost FreeFire"
        echo "3) Change CPU-GPU Renderer    7) EXIT"
        echo "4) Change OpenGL to Vulkan"
        read -p "Select an option: " option
        case "$option" in
            1) high_performance_tweaks ;;
            2) accelerate_hardware ;;
            3) change_cpu_gpu_renderer ;;
            4) change_opengl_to_vulkan ;;
            5) ram_plus_tools ;;
            6) boost_freefire ;;
            7)
                echo -e "\e[31mExiting...\e[0m"
                exit ;;
            *)
                echo "Invalid option, please select again."
                sleep 1
                ;;
        esac
    done
